export default function Home({user}){

    const[books,setBooks] = useState([])

    useEffect(()=>{
        fetch(`http://localhost:3000/books`)
        .then(response=>response.json())
        .then(data=>{setBooks(data)})
    },[])

     if (books.length > 0){
        let unfulfilledWaitings = books.select(book=>book.waiting!== true)
        console.log(unfulfilledWaitings)
    }

    return(
        <>
            <h4>Top Books People are Waiting on:</h4>
            <ol></ol>
        </>
    )
}
